import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {

    const items = ['покушать','выспаться'];
    return (
        <ul>
            <li>{items[0] }</li>
            <li>{items[1] }</li>
        </ul>
    );
}

const AppHeader = () => {
    return <h1>It's my Todo List</h1>
}

const SearchPanel = () => {
    return <input placeholder="search" />
}

const App = () => {

    const loginBox = <div>Log in please</div>

    return (
        <div>
            { loginBox }
            <AppHeader />
            <SearchPanel />
            <TodoList />
            <Footer />
            <span>{(new Date()).toString()}</span>
        </div>
    );
}
const Footer = () => React.createElement('footer', null, '© Copyright Matthew Farrel Corporation')

console.log(<TodoList />);
console.log(<App />);
ReactDOM.render(<App />, document.getElementById('root'));
